// Import CSS
import "./css/ManageLogs.css";
// Import major dependencies
import React, { useContext, useEffect } from "react";
// Import components
import Page from "../../components/Page";
import ButtonGroup from "../../components/ButtonGroup";
import Button from "../../components/Button";
// Import icons
import { FaRegClock } from "react-icons/fa";
import { CgMenuGridR } from "react-icons/cg";
import { HiPlus } from "react-icons/hi";
import FileBrowser from "../../components/FileBrowser";
import Dashboard from "../Dashboard";
import Header from "../../components/Header";
// Import API and static content

const ManageLogs = (props) => {

    const testFiles = [
        {
            name: "testing testing hello world",
            type: "log"
        }, {
            name: "lorem ipsum Dolor",
            type: "log"
        }, {
            name: "Sit amet",
            type: "log"
        }, {
            name: "testing testing hello world asd asdasd",
            type: "log"
        }, {
            name: "lorem ipsum Dolor",
            type: "log"
        }, {
            name: "Sit amet",
            type: "log"
        }, {
            name: "testing testing hello world asd asdasd",
            type: "log"
        }, {
            name: "asdasdasdasdasdas",
            type: "log"
        }
    ];
    const empty = [];

    return (
        <>
            <Header>
                <ButtonGroup buttons={[
                    <Button icon={FaRegClock}>Recent Logs</Button>,
                    <Button icon={CgMenuGridR}>All Logs</Button>,
                    <Button icon={HiPlus}>New Log</Button>
                ]}/>
            </Header>
            <Page className="with-header">
                <p className="text-lg font-bold">Your Most Recent Logs</p>
                <div className="h-4"/>
                <FileBrowser files={testFiles}/>
            </Page>
        </>
    )

}

export default ManageLogs;
